import React, { useEffect, useState} from 'react';

export default function Notes() {

    const [notes, setNotes] = useState([]);


    useEffect( () => {
        fetch('http://localhost:3000/notes')
            .then(res => res.json())
            .then(data => setNotes(notes))
    }, []);


    return(
        <div>

        </div>
    )
}
